import Navbar from "./Navbar";
import Search from "./Search";

const Header = () => (
  <div className="container-fluid header">
    <div className="row">
      <div className="col-7">
        Header
      </div>
      <div className="col-7">
        <Navbar/>
      </div>
      <div className="col">
        <Search/>
      </div>
    </div>

    <style jsx>{`
      .header {
        background-color: rgb(255, 255, 255);
      }
      * {
      border: 5px solid red;
      }
    `}</style>
  </div>
);

export default Header;
